import React from "react";

function PetShop(){

    const {cao, gato, clientes, nomeCliente} = props


    return(
        <div>
            <h1>Cachorro: {cao}</h1>
            <h1>Gato: {gato}</h1>

            <div>
                Quantidade de Clientes: {clientes}
            </div>
            <div>
                Nome do CLiente: {nomeCliente}
            </div>
        </div>
    )
}

export default PetShop;
